  "translationLines": [
    {
      "lineNumber": 102321,
      "originalJapaneseLine": "「……今日だけだ」",
      "translatedEnglishLine": "\"...Just for today.\""
    },
    {
      "lineNumber": 102322,
      "originalJapaneseLine": "「さっきまでお見合いに出ていたんだ」",
      "translatedEnglishLine": "\"I was just at a matchmaking meeting.\""
    },
    {
      "lineNumber": 102323,
      "originalJapaneseLine": "「へー……お見合い……」",
      "translatedEnglishLine": "\"Heh... a matchmaking meeting...\""
    },
    {
      "lineNumber": 102324,
      "originalJapaneseLine": "「お見合い！？」",
      "translatedEnglishLine": "\"A matchmaking meeting!?\""
    },
    {
      "lineNumber": 102325,
      "originalJapaneseLine": "「俺は何も聞いていないぞ！」",
      "translatedEnglishLine": "\"I haven't heard anything about this!\""
    },
    {
      "lineNumber": 102326,
      "originalJapaneseLine": "「報告の義務はない！」",
      "translatedEnglishLine": "\"There's no obligation to report it!\""
    },
    {
      "lineNumber": 102327,
      "originalJapaneseLine": "「認めないぞ、結婚なんて！」",
      "translatedEnglishLine": "\"I won't accept marriage or anything like that!\""
    },
    {
      "lineNumber": 102328,
      "originalJapaneseLine": "「……貴方は私の父か」",
      "translatedEnglishLine": "\"...Are you my father?\""
    },
    {
      "lineNumber": 102329,
      "originalJapaneseLine": "「いや……本当に貴方が",
      "translatedEnglishLine": "\"No... if only you really were"
    },
    {
      "lineNumber": 102330,
      "originalJapaneseLine": "　私の父なら良かったかもな」",
      "translatedEnglishLine": "my father, then maybe that would be good.\""
    },
    {
      "lineNumber": 102331,
      "originalJapaneseLine": "「今日の見合いは父が勝手に決めたことだ。",
      "translatedEnglishLine": "\"Today's matchmaking meeting was something my father decided on his own."
    },
    {
      "lineNumber": 102332,
      "originalJapaneseLine": "　あの人は私に誰かの妻となって欲しいんだ」",
      "translatedEnglishLine": "He wants me to become someone's wife.\""
    },
    {
      "lineNumber": 102333,
      "originalJapaneseLine": "「むむむ……バレスめ、勝手なことを……」",
      "translatedEnglishLine": "\"Hmmmm... Bares, doing as he pleases...\""
    },
    {
      "lineNumber": 102334,
      "originalJapaneseLine": "「私がなるのは軍人でしかないというのに……」",
      "translatedEnglishLine": "\"Even though I am only supposed to be a soldier...\""
    },
    {
      "lineNumber": 102335,
      "originalJapaneseLine": "「よし、俺から言っておいてやる」",
      "translatedEnglishLine": "\"Alright, I'll say something about it.\""
    },
    {
      "lineNumber": 102336,
      "originalJapaneseLine": "「総統命令として、ずっと軍人として",
      "translatedEnglishLine": "\"As the Supreme Commander's order, always as a soldier,"
    },
    {
      "lineNumber": 102337,
      "originalJapaneseLine": "　俺様のそばに置いておけ、とな」",
      "translatedEnglishLine": "keep her by my side.\""
    },
    {
      "lineNumber": 102338,
      "originalJapaneseLine": "「がははは、一生軍人出来るぞ、嬉しいだろう」",
      "translatedEnglishLine": "\"Gahaha, you can be a soldier for life, aren't you happy?\""
    },
    {
      "lineNumber": 102339,
      "originalJapaneseLine": "「結構だ」",
      "translatedEnglishLine": "\"That's fine.\""
    },
    {
      "lineNumber": 102340,
      "originalJapaneseLine": "「私の人生は私のもの。",
      "translatedEnglishLine": "\"My life is mine."
    },
    {
      "lineNumber": 102341,
      "originalJapaneseLine": "　父でも貴方でも、私以外のものに",
      "translatedEnglishLine": "Neither my father nor you, nor anyone else"
    },
    {
      "lineNumber": 102342,
      "originalJapaneseLine": "　勝手に決めさせるわけにはいかない」",
      "translatedEnglishLine": "can decide it without my permission.\""
    },
    {
      "lineNumber": 102343,
      "originalJapaneseLine": "「気持ちだけ受け取っておく」",
      "translatedEnglishLine": "\"I'll just accept your feelings.\""
    },
    {
      "lineNumber": 102344,
      "originalJapaneseLine": "「……強情な子め」",
      "translatedEnglishLine": "\"...You stubborn child.\""
    },
    {
      "lineNumber": 102345,
      "originalJapaneseLine": "「それより、見合いはどうなった？",
      "translatedEnglishLine": "\"More importantly, how did the matchmaking meeting go?"
    },
    {
      "lineNumber": 102346,
      "originalJapaneseLine": "　まあ、見た感じで分かるが……」",
      "translatedEnglishLine": "Well, I can tell just by looking...\""
    },
    {
      "lineNumber": 102347,
      "originalJapaneseLine": "「ああ、断ってきた」",
      "translatedEnglishLine": "\"Yeah, I refused.\""
    },
    {
      "lineNumber": 102348,
      "originalJapaneseLine": "「面倒だったからな。",
      "translatedEnglishLine": "\"Because it was troublesome."
    },
    {
      "lineNumber": 102349,
      "originalJapaneseLine": "　私は自分より弱い男の妻となる気はないと",
      "translatedEnglishLine": "I told them I have no intention of becoming the wife of a man weaker than myself.\""
    },
    {
      "lineNumber": 102350,
      "originalJapaneseLine": "　言ってやった」",
      "translatedEnglishLine": "\"I said that to them.\""
    },
    {
      "lineNumber": 102351,
      "originalJapaneseLine": "「話の流れで決闘まですることになったのは、",
      "translatedEnglishLine": "\"It was a bit much to end up dueling as things progressed,"
    },
    {
      "lineNumber": 102352,
      "originalJapaneseLine": "　いささか自分でも反省するところだが……」",
      "translatedEnglishLine": "and even I reflect on that a little...\""
    },
    {
      "lineNumber": 102353,
      "originalJapaneseLine": "「で、勝ってきたってわけか」",
      "translatedEnglishLine": "\"So, you came back victorious, huh.\""
    },
    {
      "lineNumber": 102354,
      "originalJapaneseLine": "「辛勝だったがな……」",
      "translatedEnglishLine": "\"It was a hard-won victory though...\""
    },
    {
      "lineNumber": 102355,
      "originalJapaneseLine": "「さすが父の見つけた男性というべきか……",
      "translatedEnglishLine": "\"As expected of the man my father found...\""
    },
    {
      "lineNumber": 102356,
      "originalJapaneseLine": "　心技体、全て兼ね備えたすごい人だった」",
      "translatedEnglishLine": "\"He was an amazing person with heart, skill, and body all combined.\""
    },
    {
      "lineNumber": 102357,
      "originalJapaneseLine": "「軍人としては尊敬できたのだがな……」",
      "translatedEnglishLine": "\"I could respect him as a soldier...\""
    },
    {
      "lineNumber": 102358,
      "originalJapaneseLine": "「しかし、それ負けたらどうする気だったんだ？」",
      "translatedEnglishLine": "\"But what were you planning to do if you lost that?\""
    },
    {
      "lineNumber": 102359,
      "originalJapaneseLine": "「その場合は自分が軍人として",
      "translatedEnglishLine": "\"In that case, I would admit that I was"
    },
    {
      "lineNumber": 102360,
      "originalJapaneseLine": "　半人前だったということ。",
      "translatedEnglishLine": "only a half-hearted soldier."
    },
    {
      "lineNumber": 102361,
      "originalJapaneseLine": "　素直に嫁となるさ」",
      "translatedEnglishLine": "I would obediently become his wife.\""
    },
    {
      "lineNumber": 102362,
      "originalJapaneseLine": "「極端な考え方ばかりする奴め。",
      "translatedEnglishLine": "\"You always think so extremely."
    },
    {
      "lineNumber": 102363,
      "originalJapaneseLine": "　なるほど、バレスの子だ」",
      "translatedEnglishLine": "I see, you really are Bares' child.\""
    },
    {
      "lineNumber": 102364,
      "originalJapaneseLine": "「だが、いいことを聞いた」",
      "translatedEnglishLine": "\"But I heard something good.\""
    },
    {
      "lineNumber": 102365,
      "originalJapaneseLine": "「いいこと？」",
      "translatedEnglishLine": "\"Something good?\""
    },
    {
      "lineNumber": 102366,
      "originalJapaneseLine": "「君に勝てば俺も君の",
      "translatedEnglishLine": "\"If I can beat you, then I can also be"
    },
    {
      "lineNumber": 102367,
      "originalJapaneseLine": "　ダーリンになれるということだ！」",
      "translatedEnglishLine": "your darling!\""
    },
    {
      "lineNumber": 102368,
      "originalJapaneseLine": "「がははは、覚悟ー！」",
      "translatedEnglishLine": "\"Gahaha, prepare yourself!\""
    },
    {
      "lineNumber": 102369,
      "originalJapaneseLine": "「えっ、なあっ！？」",
      "translatedEnglishLine": "\"Eh, w-wait!?\""
    },
    {
      "lineNumber": 102370,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    }
  ]
}

